import { Routes, Route, Link } from "react-router-dom";
import './App.css';
import Home from './page/Home'

function App() {
  return (
    <div className="App">
      <h1>Welcome to React Router!</h1>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </div>
  );
}

export default App;
